import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">
      <Navbar />
    </div>
  );
}

function Navbar() {
  return (
    <div class="navbar"> 
      <div class="navbar-left">
        <a href="#" class="habit-rabbit pl-3">Habbit Rabbit</a>
      </div>
      <div class="navbar-left">
        <a href="#" class="navbar-button">Home</a>
        <a href="#" class="navbar-button">About</a>
        <a href="#" class="navbar-button">Sign In</a>
      </div>
    </div>  
  );
}
export default App;
